import ReactDOM from 'react-dom';
//import { useRouter } from 'next/router';
import {API_SERVER as API_SERVER} from '../src/constants';
import Slider from '../components/Slider';
import Cookies from 'universal-cookie';
//import UserMenu from '../components/UserMenu';
import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';
import "../src/styles.css";
const cookies = new Cookies();
const hash = cookies.get('hash');

export default class Index extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      nextPage: ''
    };

    this.connectionAlive = this.connectionAlive.bind(this);

  }

  connectionAlive() {

  }

  componentDidUpdate() {
  }
  componentDidMount() {

  }
  render() {
		return (
			<Container fluid>
        <div className="row">
          <div className="col-md-2">
            <a href="/"><img src="./logo.png" alt="MYNA logo" /></a>
          </div>
          <div className="col-md-1" />
          <div className="col-md-6 capitalLetters">
            <ul className="navMenu">
              <li><a href="#">Lookbook</a></li>
              <li><a href="#">Shop Collections</a></li>
              <li><a href="#">Sustainability</a></li>
              <li><a href="#">Our Story</a></li>
            </ul>
          </div>
          <div className="col-md-1" />
          <div className="col-md-2">
            <div className="row capitalLetters">
              <div className="col-md-6 ce padtop50px">
                <a className="menu" href="#">My Account</a>
              </div>
              <div className="col-md-6 ce padtop50px">
                <a className="menu" href="#">Cart (2)</a>
              </div>
            </div>
          </div>
        </div>
        <div className="row">
          <div className="col-md-12 noPadding">
            <Slider />
          </div>
        </div>
        <div className="spacer50px" />
        <div className="row">
          <div className="col-md-12 ce capitalLetters">
            Your Loved Pieces
          </div>
        </div>
        <div className="spacer50px" />
        <div className="row">
          <div className="col-md-6 ce">
            <img src="https://placehold.co/600x400" />
            <div className="spacer50px" />
          </div>
          <div className="col-md-6 ce">
            <img src="https://placehold.co/600x400" />
            <div className="spacer50px" />
          </div>
        </div>
        <div className="row">
          <div className="col-md-12 ce">
            <img src="https://placehold.co/1600x400" />
            <div className="spacer50px" />
          </div>
        </div>
        <div className="row">
          <div className="col-md-12 ce">
            <img src="https://placehold.co/1200x400" />
            <div className="spacer50px" />
          </div>
        </div>
        <div className="row">
          <div className="col-md-6 ce">
            <img src="https://placehold.co/600x400" />
            <div className="spacer50px" />
          </div>
          <div className="col-md-6 ce">
            <img src="https://placehold.co/600x400" />
            <div className="spacer50px" />
          </div>
        </div>
      </Container>
		);
	}
}
